// Длины всех перегородок
function linesLenghts () {
    var priceByMetr = $(".wall-i-decoration li.active").attr("data-price");
    // По длине
    var bbLenght = $("#bl-scheme").width();
    var itemWidth = $("#cal-i-width option:selected").val();
    var linesAll = 0;

    $(".partition-vertical").each(function(index) {
        var lineLenght = $(".ui-slider-range", this).width();
       
        var linesLcoef = lineLenght / bbLenght;

        linesAll += linesLcoef;
    });

    // По ширине
    var bbLenghtW = $("#bl-scheme").height();
    var itemWidthW = $("#cal-i-height option:selected").val();
    var linesAllW = 0;

    $(".partition-horizontal").each(function(index) {
        var lineLenghtW = $(".ui-slider-range", this).height();

        var linesLcoefW = lineLenghtW / bbLenghtW;

        linesAllW += linesLcoefW;
    });

    // округлим блины перегородок до 2 после запятой
    var sumLenght = linesAll * itemWidth + linesAllW * itemWidthW;
    $("#lines-step #all-wall-width").text(sumLenght.toFixed(2));

    // Стоимость перегородок
    var sumPrice = Math.ceil(sumLenght * priceByMetr);
    $("#lines-step #all-wall-price").text(sumPrice);

    // В итого
    $("#cal-i-item-lines").text(sumLenght.toFixed(2));
}

